	public String criarNome(Genero genero) {
		int n1 = 0;
		int n2 = 0;
		if(genero == Genero.FEMININO) {
			n1 = (int)(Math.random()*primeiroNomeF.length);
		}else {
			n1 = (int)(Math.random()*primeiroNomeM.length);
		}
		n2 = (int)(Math.random()*sobrenome.length);
		return genero == Genero.FEMININO ? primeiroNomeF[n1] + " " + sobrenome[n2] :
			primeiroNomeM[n1] + " " + sobrenome[n2];
	}
